function findTrend(inp) {
    var total = 0;
    var numVals = 0;
    for (var i = inp[0]['values'].length - 1; i >= 0 ; i--) {
        if (inp[0]['values'][i]['value'] >= 70) {
          console.log(inp[0]['values'][i]['date']);
          return inp[0]['values'][i]['date'];
        }
    }
}

app.get('/search', function(req, res) {
    console.log('searching for: ' + req.query.name);

    var timePeriod = {
        type: 'hour',
        value: 1
    }

    google.trendData(req.query.name, timePeriod)
    .then(function(results) {
        var dateObj = new Date(findTrend(results));
        console.log("date: " + dateObj)
        res.send("Trend found:\n" + JSON.stringify(results) + "\n\n Time: " + dateObj);
    })
    .catch(function(err) {
        console.log(err);
    });
});

function parseSportsJson() {
    json = JSON.parse(jsonStr);
    plays = json['gameplaybyplay']['plays']['play'];
    for (var i = 0; i < plays.length; i++) {
        for (var j in plays[i]) {
            if (j === "fieldGoalAttempt") {
                var firstName = plays[i][j]['shootingPlayer']['FirstName'];
                var lastName = plays[i][j]['shootingPlayer']['LastName'];
                var name = firstName + ' ' + lastName;
                var shotType = plays[i][j]['shotType'];
                var date = new Date();
                var timeOfPlay = date.toTimeString(); 

                if (!(name in players)) {
                    players[name] = [];
                }

                players[name].push({
                    time : timeOfPlay,
                    desc : shotType
                });
            }
        }
    }
    console.log(players);
}

